import "./Unit.css";
import { useDispatch } from "react-redux";


export default function Unit(props) {
    const status = props.board;
    const dispatch = useDispatch();
    function help(){
        dispatch(
            {
                type:"boardClick",
                need:props.index,
            })
    }
    return (<div className = "white" onClick = {() => {
        dispatch({
            type:"boardClick",
            type:"checkSymbol",
            need:props.index,
        })
    }}> {}</div>);
}
